import { useEffect, useState } from "react";
import pro from './img/Bootlabs-logo.gif';
import slide1 from "./img/slide1.webp"
import slide2 from './img/slide2.webp'
import slide3 from './img/slide3.jpg'
import lap from './img/lap.png'
import phone from './img/phone.png'
import tv from './img/tv.png'
import profile from './img/profile2.png'
import headset from './img/headset.png'
import f1 from './img/shoes.png'
import f2 from './img/mob.png'
import display from './img/display.png'
import hdd from './img/hdd.png'
import upc from './img/upc.png'
import tools from './img/tools.png'
import React from "react";
import "./style.css";
import { Link } from "react-router-dom";
import { ReactComponent as IconSearch } from "bootstrap-icons/icons/search.svg";
import { ReactComponent as IconCart3 } from "bootstrap-icons/icons/cart3.svg";
import {
    faTwitter,
    faFacebookF,
    faInstagram,
    faYoutube,
    faApple,
    faWindows,
    faAndroid,
} from "@fortawesome/free-brands-svg-icons";

import { ReactComponent as IconTelephone } from "bootstrap-icons/icons/telephone.svg";
import { ReactComponent as IconEnvelope } from "bootstrap-icons/icons/envelope.svg";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome"
import axios from "axios";
import dell from "./img/Dell.webp";

export default function Home()

{
    // useEffect(()=>{
    //     axios.get(`http://127.0.0.1:8000/users/productview`)
    //         .then((response) => {
    //             setData(response.data)
    //         });
    //
    // },[])

    function sign()
    {
        const cookies = document.cookie.split(";").map((cookie) => cookie.trim());
        return cookies.some((cookie) => cookie.startsWith(`_id`));
    }

    function logout()
    {
        document.cookie = `_id=; expires=Thu, 01 Jan 1970 00:00:00 UTC; path=/;`;
        alert("Successfully logged out ")
    }

    const maxLength = 50; // Set your desired character limit here
    const originalText = "Your long text goes here..."; // Your long text

    const limitedText = originalText.length > maxLength
        ? originalText.slice(0, maxLength) + '...' // Append "..." if the text is truncated
        : originalText;

    const paragraphElement = document.getElementById("limited-paragraph");
    paragraphElement.textContent = limitedText;

    let bool;
    return (
        <React.Fragment>
            <body>
            <header className="p-3 border-bottom bg-light">
                <div className="container-fluid">
                    <div className="row g-3">
                        <div className="col-md-3 text-center">

                            <img className="img" src={pro} ></img>

                        </div>
                        <div className="col-md-5">

                            <form action="#" className="search">
                                <div className="input-group">
                                    <input
                                        id="search"
                                        name="search"
                                        type="text"
                                        className="form-control"
                                        placeholder="Search"
                                        required
                                    />
                                    <label className="visually-hidden" htmlFor="search"></label>
                                    <button
                                        className="btn btn-primary text-white"
                                        type="submit"
                                        aria-label="Search"
                                    >
                                        <IconSearch />
                                    </button>
                                </div>
                            </form>
                        </div>
                        <div className="col-md-4">

                            <div className="position-relative d-inline me-3">
                                <Link to="/cart" className="btn btn-primary">
                                    <IconCart3 className="i-va" />
                                    <div className="position-absolute top-0 start-100 translate-middle badge bg-danger rounded-circle">
                                        {}
                                    </div>
                                </Link>
                            </div>&emsp;
                            {
                                (
                                    sign()?(
                                            <>
                                                <div class="dropdown">
                                                    <button class="dropbtn_profile"><img className="profile_image" src={profile}/></button>
                                                    <div className="dropdown-content">
                                                        <Link to="/">My Profile</Link>
                                                        <Link to="/">Orders</Link>
                                                        <Link to="/">Notification</Link>
                                                        <a href="/" onClick={logout}>Log out</a>
                                                    </div>
                                                </div>
                                            </>
                                        ):
                                        (
                                            <>
                                                <div className="btn-group">
                                                    <button className="buttons"><Link to="/signin">Sign In</Link></button>
                                                </div>
                                            </>
                                        )
                                )
                            }
                        </div>
                    </div>
                </div>
            </header>
            {/*<div className="container my-3">*/}
            <div className="row m-4">
                    <div className="col-md-8 bg-light bg-gradient p-3 d-none d-md-block w-50 ">
                       <div className="row">
                            <div className="cartcard" style={{ lineHeight: "1" }}>
                                <img className="cartimg" src={lap}/>
                                <p className="cartpn">Laptop</p>
                                <p id="limited-paragraph"></p>
                                <p className="cartp">tdhfdghbjn</p>
                            </div>
                       </div>

                        <div className="row">
                            <div className="cartcard">

                            </div>
                        </div>
                    </div>
                    <div className="col-md-3 p-3 bg-dark bg-gradient"style={{ height: "50px",marginLeft: "20px"}}>

                    </div>
            </div>

            {/*</div>*/}
            </body>
        </React.Fragment>

    );

}
